import React from "react";

export default function Footer() {
  return (
    <div className='footer'>
      <div className='footerline'>
        <span className='line'></span>
        <img src='images/logo.png' alt='Main Logo' />
        <span className='line'></span>
      </div>
    </div>
  );
}
